import React, { Component } from "react";
import { ProfilePage } from "./src/Profile/ProfilePage.js";
import { NavBar } from "./src/Navbar/NavBar.js";
import "./App.css";

class App extends Component {
  render() {
    return (
   <div className="App" >;
    <ProfilePage />
    <NavBar />
    </div>
    );
  }
};

export default App;
